import React, { Component } from "react";
import styled from "styled-components";
import { Button } from "../index"


class Card extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <>
        <div
          style={{
            display: "flex",
            flexDirection: "column",
            flex: 1,
            width :"100%",
            height :"100%",
            maxWidth: "252px",
            maxHeight: "284px",
            padding: "32px",
            borderRadius: "10px",
            boxShadow: "5px 5px 15px rgba(0, 0, 0, 0.15)",
            justifyContent: "space-evenly",
            alignItems: "center",
          }}
        >
          <img src={require("../../assets/public.svg")} />
          <div style={{ margin: "5%", fontSize :"1.2em", fontWeight :"500" }}>Public Q&A</div>
          <div style={{ textAlign: "center", margin : "5%" }}>
            Get answers to more than 16.5 million questions and give back by
            sharing your knowledge with others. Sign up for an account.
          </div>
          <Button primary>Browse Questions</Button>
        </div>
      </>
    );
  }
}

export default Card;
